import React, { FormEvent } from "react";
import Form from "react-bootstrap/Form";
import Button from "react-bootstrap/Button";
import { useState, useEffect } from "react";
import { useForm } from "react-hook-form";

const DDForm = () => {
  const { register, handleSubmit } = useForm();

  const onSubmit = (data: any) => {
    console.log(data);
  };
  return (
    <Form onSubmit={handleSubmit(onSubmit)}>
      {/* Purchase Received */}
      <Form.Group>
        <Form.Label>Purchase Received</Form.Label>
        <Form.Control
          name="purchaseReceived"
          as="select"
          ref={register({ required: true })}
        >
          <option>Yes</option>
          <option>No</option>
        </Form.Control>
      </Form.Group>

      {/* Order # */}
      <Form.Group>
        <Form.Control
          name="orderNumber"
          placeholder="Order #"
          ref={register({ required: true })}
        ></Form.Control>
      </Form.Group>

      {/* Vendor */}
      <Form.Group>
        <Form.Control
          name="vendor"
          as="select"
          defaultValue="Choose Vendor..."
          ref={register({ required: true })}
        >
          <option>Choose Vendor...</option>
          {vendorList.map((vendor) => (
            <option key={vendor}>{vendor}</option>
          ))}
        </Form.Control>
      </Form.Group>

      {/* SKU Number */}
      <Form.Group>
        <Form.Control
          name="skuNumber"
          placeholder="SKU #"
          ref={register({ required: true })}
        ></Form.Control>
      </Form.Group>

      {/* Damage Level */}
      <Form.Group>
        <Form.Control
          name="damageLevel"
          as="select"
          defaultValue="Damage Level..."
          ref={register({ required: true })}
        >
          <option>Damage Level...</option>
          {damageLevels.map((level) => (
            <option key={level}>{level}</option>
          ))}
        </Form.Control>
      </Form.Group>

      <Button type="submit">Submit</Button>
    </Form>
  );
};

export default DDForm;

const vendorList = ["vendor1", "vendor2", "vendor3", "vendor4", "vendor 5"];
const damageLevels = ["Level 1", "Level 2", "Level 3"];
